// Translate the data to latLngs and encode.  Called by showCode or 
// showMap, if necessary.
// Most of the work is done by a PolylineEncoder object.
function encodeData() {
 	var polylineEncoder = new PolylineEncoder(numLevels, zoomFactor, verySmall);
 	var thisPolygonResults, thisPathResults;
 	var i, j, k, latLngs;
 	
	pathResults = new Array(0);
	polygonResults = new Array(0);
 	if(pathData.length > 0) {
 		minLat = maxLat = pathData[0][0][0][0];
 		minLng = maxLng = pathData[0][0][0][1];
 	}
 	else if(polygonData.length > 0) {
 		minLat = maxLat = polygonData[0][0][0][0];
 		minLng = maxLng = polygonData[0][0][0][1];
 	}
 	for(i=0; i<pathData.length; i++) {
 		thisPathResults = new Array(0);
 		for(j=0; j<pathData[i].length; j++) {
 			latLngs = new Array(0);
 			for(k=0; k<pathData[i][j].length; k++) {
 				latLngs.push(new PolylineEncoder.latLng(pathData[i][j][k][0],pathData[i][j][k][1]));
	 			if(1*pathData[i][j][k][0] < 1*minLat) {
	 				minLat = pathData[i][j][k][0];
	 			}
	 			if(1*pathData[i][j][k][0] > 1*maxLat) {
	 				maxLat = pathData[i][j][k][0];
	 			}
	 			if(1*pathData[i][j][k][1] < 1*minLng) {
	 				minLng = pathData[i][j][k][1];
	 			}
	 			if(1*pathData[i][j][k][1] > 1*maxLng) {
	 				maxLng = pathData[i][j][k][1];
	 			}
  			}
 			thisPathResults.push(polylineEncoder.dpEncode(latLngs));
 		}
 		pathResults.push(thisPathResults);
 	}
 	
 	for(i=0; i<polygonData.length; i++) {
 		thisPolygonResults = new Array(0);
 		for(j=0; j<polygonData[i].length; j++) {
 			latLngs = new Array(0);
 			for(k=0; k<polygonData[i][j].length; k++) {
 				latLngs.push(new PolylineEncoder.latLng(polygonData[i][j][k][0],polygonData[i][j][k][1]));
	 			if(1*polygonData[i][j][k][0] < 1*minLat) {
	 				minLat = polygonData[i][j][k][0];
	 			}
	 			if(1*polygonData[i][j][k][0] > 1*maxLat) {
	 				maxLat = polygonData[i][j][k][0];
	 			}
	 			if(1*polygonData[i][j][k][1] < 1*minLng) {
	 				minLng = polygonData[i][j][k][1];
	 			}
	 			if(1*polygonData[i][j][k][1] > 1*maxLng) {
	 				maxLng = polygonData[i][j][k][1];
	 			}
  			}
 			thisPolygonResults.push(polylineEncoder.dpEncode(latLngs));
 		}
 		polygonResults.push(thisPolygonResults);
 	}
}

// The last step of the showCode function.
function writeCode() {
	var w = open("","","scrollbars=yes,resizable=yes");
	var i, j, latCenter, lngCenter;
	
	latCenter = (1*minLat + 1*maxLat)/2;
	lngCenter = (1*minLng + 1*maxLng)/2;
	w.document.write("<title>Encoded polyline code</title><pre><code>");
	w.document.write("var sw = new GLatLng(" + minLat + ", " + minLng + ");\n");
	w.document.write("var ne = new GLatLng(" + maxLat + ", " + maxLng + ");\n");
	w.document.write("var bounds = new GLatLngBounds(sw, ne);\n");
	w.document.write("var mapZoomLevel = map.getBoundsZoomLevel(bounds);\n");
	w.document.write("var mapCenter = new GLatLng(" + latCenter + ", " + lngCenter + ")\n");
	w.document.write("map.setCenter(mapCenter, mapZoomLevel);\n\n");
	w.document.write("var polygons = Array(0);\n\n");
	
	for(i=0; i<polygonData.length; i++) {
		w.document.write("var polygon", i+1, " = new GPolygon.fromEncoded({\n");
		w.document.write("  polylines: [\n");
		for(j=0; j<polygonData[i].length-1; j++) {
			w.document.write("    {points: \"", polygonResults[i][j].encodedPointsLiteral, "\",\n");
			w.document.write("     levels: \"", polygonResults[i][j].encodedLevels, "\",\n");
			w.document.write("     color: \"" + colorString(i) + "\",\n");
			w.document.write("     opacity: 0.7,\n");
			w.document.write("     weight: 3,\n");
			w.document.write("     numLevels: ", numLevels, ",\n");
			w.document.write("     zoomFactor: ", zoomFactor, "},\n");
		}
		w.document.write("    {points: \"", polygonResults[i][j].encodedPointsLiteral, "\",\n");
		w.document.write("     levels: \"", polygonResults[i][j].encodedLevels, "\",\n");
		w.document.write("     color: \"" + colorString(i) + "\",\n");
		w.document.write("     opacity: 0.7,\n");
		w.document.write("     weight: 3,\n");
		w.document.write("     numLevels: ", numLevels, ",\n");
		w.document.write("     zoomFactor: ", zoomFactor, "}],\n");
		w.document.write("  fill: true,\n", "  color: \"" + colorString(i) + "\",\n", "  opacity: 0.4,\n  outline: true\n", "});\n");
		w.document.write("map.addOverlay(polygon", i+1, ");\n");
		w.document.write("polygons.push(polygon", i+1, ");\n\n")
	}
	
	for(i=0; i<pathData.length; i++) {
		for(j=0; j<pathData[i].length; j++) {
			w.document.write("var polyline", i+1,"_",j+1, " = new GPolyline.fromEncoded({\n  color: \"" + colorString(i) + "\",\n  weight: 4,\n  opacity: 0.8,\n  points: \"");
			w.document.write(pathResults[i][j].encodedPointsLiteral, "\",\n");
			w.document.write("  levels: \"", pathResults[i][j].encodedLevels, "\",\n");
			w.document.write("  zoomFactor: ", zoomFactor, ", \n");
			w.document.write("  numLevels: ", numLevels, "\n});\n");
			w.document.write("map.addOverlay(polyline",i+1,"_",j+1,");\n\n");
		}
	}
	w.document.close();
}

// The last step of the showMap function.
function setMap() {
	var polyline, polylines, polygon;
	var latCenter, lngCenter, i, j;
	var sw = new GLatLng(minLat, minLng);
	var ne = new GLatLng(maxLat, maxLng);
	latCenter = (1*minLat + 1*maxLat)/2;
	lngCenter = (1*minLng + 1*maxLng)/2;
	
	var bounds = new GLatLngBounds(sw, ne);
	var mapZoomLevel = map.getBoundsZoomLevel(bounds);
	var mapCenter = new GLatLng(latCenter, lngCenter)
	map.setCenter(mapCenter, mapZoomLevel);
	
	for(i=0; i<pathData.length; i++) {
		for(j=0; j<pathData[i].length; j++) {
			polyline = new GPolyline.fromEncoded({
				color: colorString(i),
				weight: 4,
				opacity: 0.8,
				points: pathResults[i][j].encodedPoints,
				levels: pathResults[i][j].encodedLevels,
				zoomFactor: zoomFactor,
				numLevels: numLevels});
			map.addOverlay(polyline);
		}
	}

	for(i=0; i<polygonData.length; i++) {
		polylines = new Array(0);
		for(j=0; j<polygonData[i].length; j++) {
			polyline = {
				points: polygonResults[i][j].encodedPoints,
				levels: polygonResults[i][j].encodedLevels,
				color: colorString(i),
				numLevels: numLevels,
				zoomFactor: zoomFactor};
			polylines.push(polyline);
		}
		polygon  = new GPolygon.fromEncoded({
			polylines: polylines,
			fill: true,
			color: colorString(i),
			outline: true});
		map.addOverlay(polygon);
	}
}

// Chooses the color of the ith object.
function colorString(i) {
	var colorStep = 6408323;
	return "#" + ((Math.floor((0xff + i*colorStep)) % 0x1000000) + 
		0x1000000).toString(16).substring(1);
}


// The rest of the functions respond to various events.
function load() {
	// Set up the initial form state.
	inputText = "";
	stateChange = false;
	document.getElementById("EncodingForm").latlngorder[0].checked = true;
	commentary = true;
	document.getElementById("EncodingForm").commentarySwitch[0].checked = true;
	order = "latlng";
	document.getElementById("EncodingForm").verySmall.value = 0.00001;
 	document.getElementById("EncodingForm").numLevels.value = 18;
	document.getElementById("EncodingForm").zoomFactor.value = 2;
	document.getElementById("EncodingForm").InputText.value = "";
	document.getElementById("EncodingForm").example.value = "none";

	// Set up the initial map state.
	if(document.implementation.hasFeature(
	  "http://www.w3.org/TR/SVG11/feature#SVG","1.1")){ 
		_mSvgEnabled = true;
		_mSvgForced  = true;
	}
	map = new GMap2(document.getElementById("map"));
	GEvent.addListener(map, "moveend", function() {
		var zoomLevel = map.getZoom();
		var center = map.getCenter();
		document.getElementById("message").innerHTML = 
			"zoom level = " + zoomLevel.toString() + "<br />\n" +
			"center = " + center.toString();
	});
	map.addControl(new GLargeMapControl());
	map.addControl(new GMapTypeControl());
	map.addControl(new GScaleControl());
	var omc = new GOverviewMapControl();
	map.addControl(omc);
	omc.hide();
	map.setCenter(new GLatLng(27, -22), 2);
}

